const reducer = (state = [], action ) =>{
  switch (action.type) {
    case "GETTEACHERTABLE":
      // console.log(action.payload.token);
      return [...state,action.payload]
    case "LOGOUTTEACHER":
      localStorage.clear();
      // console.log(action.payload)
      return {...state, authData: null}
    default:
      return state;
  }
}

export default reducer
